Movie Info: Grand Masti also referred to as Masti 2 is a Bollywood adult comedy film directed by Indra Kumar and produced by Ashok Thakeria. The film is a sequel to the 2004 film Masti, and features Vivek Oberoi, Aftab Shivdasani and Riteish Deshmukh reprising their roles from the original, along with Bruna Abdullah, Karishma Tanna, Sonalee Kulkarni, Kainaat Arora, Maryam Zakaria and Manjari Fadnis. Grand Masti released on 13 September 2013. The film received largely negative response from critics, but was received well at the box office. Grand Masti is the highest grossing Bollywood film with an A (Adults Only) certificate in India, subsequently entering Bollywood's 100 crore club in India. The film was declared a Super Hit in India by Box Office India.


